import React, { useContext} from 'react';
import RootContext from "../../providers/root";
import './title-half.css';

function TitleHalf() {
    const {
        setCurrentPage
    } = useContext(RootContext);
    
    return (
        <div className='title-half'>
            <p>Title</p>
        </div>
    );
}

export default TitleHalf;
